ence_pubmed>\n      </GBReference>\n      <GBReference>\n        <GBReference_reference>2</GBReference_reference>\n        <GBReference_position>1..5149</GBReference_position>\n        <GBReference_authors>\n          <GBAuthor>Astell,C.R.</GBAuthor>\n          <GBAuthor>Gardiner,E.M.</GBAuthor>\n          <GBAuthor>Tattersall,P.</GBAuthor>\n        </GBReference_authors>\n        <GBReference_title>DNA sequence of the lymphotropic variant of minute virus of mice, MVM(i), and comparison with the DNA sequence of the fibrotropic prototype strain</GBReference_title>\n        <GBReference_journal>J. Virol. 57 (2), 656-669 (1986)</GBReference_journal>\n        <GBReference_pubmed>3502703</GBReference_pubmed>\n      </GBReference>\n      <GBReference>\n        <GBReference_reference>3</GBReference_reference>\n        <GBReference_position>1..5149</GBReference_position>\n        <GBReference_authors>\n          <GBAuthor>Astell,C.R.</GBAuthor>\n          <GBAuthor>Thomson,M.</GBAuthor>\n          <GBAuthor>Merchlinsky,M.</GBAuthor>\n          <GBAuthor>Ward,D.C.</GBAuthor>\n        </GBReference_authors>\n        <GBReference_title>The complete DNA sequence of minute virus of mice, an autonomous parvovirus</GBReference_title>\n        <GBReference_journal>Nucleic Acids Res. 11 (4), 999-1018 (1983)</GBReference_journal>\n        <GBReference_pubmed>6298737</GBReference_pubmed>\n      </GBReference>\n      <GBReference>\n        <GBReference_reference>4</GBReference_reference>\n        <GBReference_position>1..5149</GBReference_position>\n        <GBReference_consortium>NCBI Genome Project</GBReference_consortium>\n        <GBReference_title>Direct Submission</GBReference_title>\n        <GBReference_journal>Submitted (01-AUG-2000) National Center for Biotechnology Information, NIH, Bethesda, MD 20894, USA</GBReference_journal>\n      </GBReference>\n    </GBSeq_references>\n    <GBSeq_comment>PROVISIONAL REFSEQ: This record has not yet been subject to final NCBI review. The reference sequence is identical to J02275.; On or before Mar 28, 2016 this sequence version replaced NC_008186.1, NC_011618.1, NC_001358.1, NC_004713.1, NC_008185.1, NC_001630.1, NC_011619.1.; The parvoviridae family cantains two groups that infect mammalian hosts: (i) defective (helper-dependent) adeno-associated viruses, and (ii) autonomous (helper-independent) parvoviruses. MVM is a member of the latter group. Both groups have been demonstrated to package both plus and minus strands (in separate particles) of the ss-DNA genome, though the minus strand is more typically packaged in the latter group.~The sequence below corresponds to the plus (+) strand, also referred to as the C-strand. The minus (-) strand is also referred to as the V-strand.~The 3\' and 5\' termini both exhibit the potential for forming stable \'fold-back\' hairpins; these sequences appear to play a role in replication [1].~The left and right halves of the genome encode two distinct, but overlapping transcriptional units. The transcripts can be summarized [1] (1 map unit (mu) = 51 bp):~ R1 (4.8 kb): 4.5 mu - 46 mu; 46+ mu - 95 mu~ R2 (3.3 kb): 4.5 mu - 10.7 mu; 38 mu - 46 mu; 46+ mu - 95 mu~ R3 (3.0 kb): 40 mu - 46 mu; 46+ mu - 95 mu~R3 is the major transcript.~There are two major open reading frames, both on the plus (or C) strand. The left side ORF (261-2279) probably encodes a non-capsid protein of 85 kd; the right side ORF probably encodes the viral capsid proteins, VP1 (or A, 83 kd), VP2 (or B, 64 kd), and VP3 (or C, 61 kd). But because of uncertainties about the precise splice points in the transcripts, the exact starts, stops and (possible) intron boundaries are not known.~revision 4804 4870 a-65bp-a in [2]; aa in [1] [2] revises [1].~[3] sites; splice sites.; COMPLETENESS: full length.</GBSeq_comment>\n    <GBSeq_feature-table>\n      <GBFeature>\n        <GBFeature_key>source</GBFeature_key>\n        <GBFeature_location>1..5149</GBFeature_location>\n        <GBFeature_intervals>\n     